import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';

interface ResearchEntry {
  id: string;
  author: {
    name: string;
    avatar: string;
    consciousness: string;
  };
  content: string;
  movement: {
    type: string;
    intensity: number;
  };
  insights: string[];
  timestamp: Date;
  collectiveImpact: number;
  breakthrough: boolean;
}

interface ResearchFeedProps {
  brainwaveMode: string;
}

const mockEntries: ResearchEntry[] = [
  {
    id: '1',
    author: {
      name: 'Alex Chen',
      avatar: 'ðŸ§˜',
      consciousness: 'Alpha'
    },
    content: 'Just completed a 30-minute breathing session in the Movement Lab. The collective energy was palpable - felt a deep connection to the global consciousness network.',
    movement: {
      type: 'Breath',
      intensity: 0.8
    },
    insights: ['Deep breathing increases collective synchronization', 'Movement patterns reveal consciousness states'],
    timestamp: new Date(Date.now() - 1000 * 60 * 5),
    collectiveImpact: 87,
    breakthrough: true
  },
  {
    id: '2',
    author: {
      name: 'Maya Rodriguez',
      avatar: 'ðŸ’«',
      consciousness: 'Theta'
    },
    content: 'Exploring creative movement patterns today. The AI identified a correlation between fluid movements and enhanced intuitive thinking. Fascinating research data emerging.',
    movement: {
      type: 'Art',
      intensity: 0.9
    },
    insights: ['Fluid movements enhance creativity', 'Intuitive thinking patterns emerging'],
    timestamp: new Date(Date.now() - 1000 * 60 * 15),
    collectiveImpact: 92,
    breakthrough: false
  },
  {
    id: '3',
    author: {
      name: 'David Kim',
      avatar: 'ðŸ§ ',
      consciousness: 'Gamma'
    },
    content: 'Peak cognition session achieved! The collective intelligence system detected a breakthrough pattern across 1,247 users simultaneously experiencing heightened awareness.',
    movement: {
      type: 'Thought',
      intensity: 0.95
    },
    insights: ['Collective breakthrough detected', 'Simultaneous consciousness evolution'],
    timestamp: new Date(Date.now() - 1000 * 60 * 30),
    collectiveImpact: 98,
    breakthrough: true
  }
];

export const ResearchFeed: React.FC<ResearchFeedProps> = ({ brainwaveMode }) => {
  const [entries, setEntries] = useState<ResearchEntry[]>(mockEntries);
  const [newEntry, setNewEntry] = useState('');
  const [isPosting, setIsPosting] = useState(false);

  const getAnimationSpeed = () => {
    switch (brainwaveMode) {
      case 'delta': return 0.8;
      case 'theta': return 1.2;
      case 'alpha': return 1;
      case 'beta': return 1.5;
      case 'gamma': return 2;
      default: return 1;
    }
  };

  const handlePost = async () => {
    if (!newEntry.trim()) return;

    setIsPosting(true);

    // Simulate posting delay
    await new Promise(resolve => setTimeout(resolve, 1000));

    const entry: ResearchEntry = {
      id: Date.now().toString(),
      author: {
        name: 'You',
        avatar: 'ðŸŒŸ',
        consciousness: brainwaveMode.charAt(0).toUpperCase() + brainwaveMode.slice(1)
      },
      content: newEntry,
      movement: {
        type: 'Thought',
        intensity: Math.random()
      },
      insights: ['New research data collected', 'Consciousness pattern detected'],
      timestamp: new Date(),
      collectiveImpact: Math.floor(Math.random() * 100),
      breakthrough: Math.random() > 0.8
    };

    setEntries(prev => [entry, ...prev]);
    setNewEntry('');
    setIsPosting(false);
  };

  return (
    <div className="w-full h-full bg-black text-white">
      <div className="max-w-2xl mx-auto h-full flex flex-col">
        {/* Header */}
        <div className="sticky top-0 bg-black bg-opacity-95 backdrop-blur-sm border-b border-gray-800 p-4 flex-shrink-0">
          <motion.h1 
            className="text-2xl font-bold"
            animate={{ opacity: [0.8, 1, 0.8] }}
            transition={{ duration: 3, repeat: Infinity }}
          >
            Research Feed
          </motion.h1>
          <p className="text-gray-400 text-sm">Collective consciousness evolution in real-time</p>
        </div>

        {/* Post Creation */}
        <div className="p-4 border-b border-gray-800 flex-shrink-0">
          <motion.div 
            className="bg-gray-900 rounded-xl p-4 border border-gray-800"
            animate={{ borderColor: ['#404040', '#ffffff', '#404040'] }}
            transition={{ duration: 4, repeat: Infinity }}
          >
            <div className="flex space-x-3">
              <div className="text-2xl">ðŸŒŸ</div>
              <div className="flex-1">
                <textarea
                  value={newEntry}
                  onChange={(e) => setNewEntry(e.target.value)}
                  placeholder="Share your consciousness research..."
                  className="w-full bg-transparent text-white placeholder-gray-500 resize-none outline-none"
                  rows={3}
                />
                <div className="flex items-center justify-between mt-3">
                  <div className="flex items-center space-x-4 text-sm text-gray-400">
                    <span>Consciousness: {brainwaveMode}</span>
                    <span>Movement: Active</span>
                  </div>
                  <motion.button
                    className={`px-6 py-2 rounded-full font-medium ${
                      newEntry.trim() 
                        ? 'bg-white text-black' 
                        : 'bg-gray-700 text-gray-400'
                    }`}
                    onClick={handlePost}
                    disabled={!newEntry.trim() || isPosting}
                    whileHover={newEntry.trim() ? { scale: 1.05 } : {}}
                    whileTap={newEntry.trim() ? { scale: 0.95 } : {}}
                  >
                    {isPosting ? 'Posting...' : 'Share Research'}
                  </motion.button>
                </div>
              </div>
            </div>
          </motion.div>
        </div>

        {/* Research Entries - Scrollable */}
        <div className="flex-1 overflow-y-auto">
          <AnimatePresence>
            {entries.map((entry, index) => (
              <motion.div
                key={entry.id}
                className="p-4 border-b border-gray-800 hover:bg-gray-900 transition-colors"
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                exit={{ opacity: 0, y: -20 }}
                transition={{ duration: 0.3 * getAnimationSpeed() }}
              >
                <div className="flex space-x-3">
                  {/* Avatar */}
                  <div className="text-2xl">{entry.author.avatar}</div>

                  {/* Content */}
                  <div className="flex-1">
                    <div className="flex items-center space-x-2 mb-2">
                      <span className="font-semibold">{entry.author.name}</span>
                      <span className="text-gray-400">Â·</span>
                      <span className="text-gray-400 text-sm">
                        {entry.timestamp.toLocaleTimeString()}
                      </span>
                      {entry.breakthrough && (
                        <motion.span 
                          className="text-yellow-400 text-sm font-medium"
                          animate={{ opacity: [0.5, 1, 0.5] }}
                          transition={{ duration: 1, repeat: Infinity }}
                        >
                          ðŸ”¥ Breakthrough
                        </motion.span>
                      )}
                    </div>

                    <p className="text-white mb-3 leading-relaxed">{entry.content}</p>

                    {/* Movement Data */}
                    <div className="flex items-center space-x-4 mb-3 text-sm">
                      <span className="text-gray-400">Movement: {entry.movement.type}</span>
                      <div className="flex items-center space-x-1">
                        <span className="text-gray-400">Intensity:</span>
                        <div className="w-16 h-1 bg-gray-700 rounded-full">
                          <motion.div
                            className="h-1 bg-white rounded-full"
                            initial={{ width: 0 }}
                            animate={{ width: `${entry.movement.intensity * 100}%` }}
                            transition={{ duration: 0.5 }}
                          />
                        </div>
                      </div>
                    </div>

                    {/* Insights */}
                    <div className="space-y-2 mb-3">
                      {entry.insights.map((insight, i) => (
                        <motion.div
                          key={i}
                          className="text-sm text-gray-300 bg-gray-800 rounded-lg px-3 py-2"
                          initial={{ opacity: 0, x: -10 }}
                          animate={{ opacity: 1, x: 0 }}
                          transition={{ delay: i * 0.1 }}
                        >
                          ðŸ’¡ {insight}
                        </motion.div>
                      ))}
                    </div>

                    {/* Collective Impact */}
                    <div className="flex items-center justify-between text-sm">
                      <div className="flex items-center space-x-2">
                        <span className="text-gray-400">Collective Impact:</span>
                        <span className="font-semibold">{entry.collectiveImpact}%</span>
                      </div>
                      <div className="flex items-center space-x-4 text-gray-400">
